import { withFactory as _effector$factory } from 'effector';
import { createEffect, createEvent, createStore, restore, sample } from 'effector';
import { createGate } from 'effector-react';
import { isNull } from 'lodash-es';
import { delay } from 'patronum';
import { atom } from '@/shared/factories';
import { getCurrentValue } from '@/entities/Test/model/getCurrentValue';
import { isValidAnswer } from '@/entities/Test/model/isValidAnswer';
import { getQuestionsQuery } from '../api';
import { DELAY_MS } from './constants';
import { getProgress } from './getProgress';
/**
 * Модель теста, реализованная на Effector atom.
 * @returns {object} API для управления состоянием теста
 */ export const TestModel = _effector$factory({
    sid: "8q1iemyo",
    fn: ()=>atom(()=>{
            /** Гейт для инициализации/размонтирования компонента теста */ const TestGate = createGate({
                and: [],
                or: {
                    sid: "89fapg0b"
                }
            });
            /** Событие сброса формы */ const formReset = createEvent({
                sid: "4b0k0due"
            });
            /** Событие для управления видимостью сплэш-экрана */ const setSplashScreenVisibility = createEvent({
                sid: "8ivohf3p"
            });
            /** Событие изменения поля шкалы */ const scaleFormFieldChanged = createEvent({
                sid: "6j7wbr4"
            });
            /**
     * Стор с ответами пользователя
     */ const $scaleForm = createStore({
                answers: []
            }, {
                sid: "a9098cvw"
            }).reset(formReset).on(scaleFormFieldChanged, (form, field)=>{
                const updatedAnswers = [
                    ...form.answers
                ];
                updatedAnswers[field.index] = field;
                return {
                    ...form,
                    answers: updatedAnswers
                };
            });
            /** Текущая страница теста */ const $currentPage = createStore(1, {
                sid: "b7vu0903"
            }).reset(formReset);
            /** Текущий прогресс (в процентах) */ const $currentProgress = createStore(0, {
                sid: "brzu2ok9"
            }).reset(formReset);
            /** Текущий вопрос */ const $currentQuestion = createStore(null, {
                sid: "ccugkeg3"
            });
            /** Текущее значение ответа */ const $currentValue = createStore(null, {
                sid: "buxe0nw4"
            }).reset(formReset);
            /** Видимость сплэш-экрана */ const $isSplashScreenVisible = createStore(true, {
                sid: "ls62vx7"
            }).reset(formReset);
            /** Событие смены направления (вперед/назад) */ const directionChanged = createEvent({
                sid: "8hx2bsq7"
            });
            /** Стор направления */ const $direction = createStore('forward', {
                sid: "5trycyme"
            }).on(directionChanged, (_, dir)=>dir);
            /** Событие смены страницы формы */ const formPageChanged = createEvent({
                sid: "5zz0rnbq"
            });
            /** Задержка для события изменения поля */ const delayedFormFieldChanged = _effector$factory({
                sid: "8rf797m9",
                fn: ()=>delay(scaleFormFieldChanged, DELAY_MS)
            });
            /** Стор с вопросами */ const $questions = restore(getQuestionsQuery.finished.success.map((el)=>el.result), [], {
                sid: "8lo6afp1"
            });
            // --- Реактивные связи ---
            const scrollToTopFx = createEffect(()=>{
                window.scrollTo({
                    top: 0,
                    behavior: 'smooth'
                });
            }, {
                sid: "8qy6g9rk"
            });
            sample({
                and: [
                    {
                        clock: setSplashScreenVisibility,
                        target: [
                            $isSplashScreenVisible,
                            scrollToTopFx
                        ]
                    }
                ],
                or: {
                    sid: "8xt04xn6"
                }
            });
            sample({
                and: [
                    {
                        clock: [
                            $currentPage,
                            $questions,
                            TestGate.open
                        ],
                        source: {
                            page: $currentPage,
                            questions: $questions
                        },
                        fn: ({ page, questions })=>{
                            if (!questions) return null;
                            return questions[page - 1];
                        },
                        target: $currentQuestion
                    }
                ],
                or: {
                    sid: "1md6343u"
                }
            });
