                and: [
                    {
                        clock: delayedFormFieldChanged,
                        source: {
                            page: $currentPage,
                            progress: $currentProgress,
                            direction: $direction,
                            form: $scaleForm,
                            questions: $questions
                        },
                        filter: (params, field)=>!field.isMultiple && params.direction === 'forward',
                        fn: ({ page, progress, form }, answer)=>{
                            const currentAnswer = form.answers[page - 1];
                            if (!isValidAnswer(currentAnswer)) return page;
                            const singleValue = (answer?.answer).value;
                            const isValidSingle = singleValue !== '' && singleValue !== undefined && !isNull(singleValue);
                            if (answer.showInput || !isValidSingle) return page;
                            if (isValidSingle && progress < 100 && page === form.answers.length) {
                                return page + 1;
                            }
                            return page;
                        },
                        target: formPageChanged
                    }
                ],
                or: {
                    sid: "315rbtcb"
                }
            });
            // --- Получение значения для шкалы (не single/multi) ---
            sample({
                and: [
                    {
                        clock: scaleFormFieldChanged,
                        source: {
                            form: $scaleForm,
                            page: $currentPage
                        },
                        filter: (_, field)=>!(field.isMultiple || field.isSingle),
                        fn: ({ form, page })=>{
                            const currentPage = page - 1;
                            const current = form.answers[currentPage];
                            if (form.answers && form.answers.length > 0 && current && 'value' in current.answer) {
                                if (!current.answer.value) return null;
                                return current.answer.value;
                            }
                            return null;
                        },
                        target: $currentValue
                    }
                ],
                or: {
                    sid: "bw7xr6h3"
                }
            });
            // --- Получение значения для текущего ответа (single/multi/scale) ---
            sample({
                and: [
                    {
                        clock: [
                            $scaleForm,
                            formPageChanged
                        ],
                        source: {
                            form: $scaleForm,
                            page: $currentPage
                        },
                        fn: ({ form: { answers }, page }, pages)=>getCurrentValue(answers, page, pages),
                        target: $currentValue
                    }
                ],
                or: {
                    sid: "43pew38m"
                }
            });
            // --- Смена страницы и скролл вверх ---
            sample({
                and: [
                    {
                        clock: formPageChanged,
                        fn: (page)=>{
                            window.scrollTo(0, 0);
                            return page;
                        },
                        target: $currentPage
                    }
                ],
                or: {
                    sid: "9ozjtlyt"
                }
            });
            // --- Обновление прогресса ---
            sample({
                and: [
                    {
                        clock: $scaleForm,
                        source: {
                            questions: $questions,
                            form: $scaleForm
                        },
                        fn: ({ questions, form: { answers } })=>getProgress(answers.length, questions.length),
                        target: $currentProgress
                    }
                ],
                or: {
                    sid: "3sm1l2v1"
                }
            });
            /**
     * API модели теста
     */ return {
                setSplashScreenVisibility,
                $scaleForm,
                $currentPage,
                $currentProgress,
                formReset,
                $currentQuestion,
                formPageChanged,
                $currentValue,
                directionChanged,
                $isSplashScreenVisible,
                scaleFormFieldChanged,
                $questions,
                TestGate
            };
        })
});

